anf("%lld%lld %s",&n,&k,s);
	k--;
	ll crr=0;
	for(int i=0;i<n;i++){
		cnt[n-i]+=cnt[n-i+1];
		if(s[i]=='0'){
			cnt[0]+=crr+1;
			crr++;
		}else{
			cnt[n-i]+=crr+1;
			wei[i]=crr+1;
			crr=0;
		}
	}

	int keta=0;
	while(k>=cnt[keta])k-=cnt[keta++];
	if(keta==0){
		puts("0");
		return 0;
	}
	//keta桁で、小さい方からk番目
	int*p=makeSA(s,n);

	for(int i=0;i<n;i++){
		if(p[i]+keta<=n){
			k-=wei[p[i]];
			if(k<0){
				for(int j=0;j<keta;j++)putchar(s[p[i]+j]);puts("");
				return 0;
			}
		}
	}
}
